if mibBuilder.loadTexts: powerPolicyName.setDescription('The short name of the power policy. The following are the possible names and their detailed description: Power Module Redundancy Intended for a single power source into the chassis where each Power Module is on its own dedicated circuit. Total allowed power draw is limited to one less than the number of Power Modules when more than one Power Module is present. One Power Module can fail without affecting blade operation. Multiple Power Module failures can cause the chassis to power off. Note that some blades may not be allowed to power on if doing so would exceed the policy power limit. Power Module Redundancy with Blade Throttling Allowed Very similar to the Power Module Redundancy policy. This policy allows you to draw more total power; however, capable blades may be allowed to throttle down if one Power Module fails. Basic Power Management Total allowed power is higher than other policies and is limited only by the total power capacity of all the Power Modules up to the maximum of chassis power rating. This is the least conservative approach, since it does not provide any protection for power source or Power Module failure. If any single power supply fails, blade and/or chassis operation may be affected. Power Source Redundancy Intended for dual power sources into the chassis. Total allowed power draw is limited to the capacity of two Power Modules. This is the most conservative approach and is recommended when all four Power Modules are installed. When the chassis is correctly wired with dual power sources, one power source can fail without affecting blade operation. Note that some blades may not be allowed to power on if doing so would exceed the policy power limit. Power Source Redundancy with Blade Throttling Allowed Very similar to the Power Source Redundancy policy. This policy allows you to draw more total power; however, capable blades may be allowed to throttle down if one power source fails.')
