ldapGroupFilter = MibScalar((1, 3, 6, 1, 4, 1, 2, 3, 51, 2, 4, 9, 3, 6, 9), OctetString().subtype(subtypeSpec=ValueSizeConstraint(0, 511))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: ldapGroupFilter.setStatus('mandatory')
if mibBuilder.loadTexts: ldapGroupFilter.setDescription('This filter is used for group authentication. It specifies what group or groups that this MM belongs to. If left blank, group authentication is disabled. Otherwise, group authentication will be performed against the filter. The filter can be a specific group name (e.g. RSAWest), a wildcard (*) which matches everything, or a wildcard with a prefix (e.g. RSA*). The default filter is RSA*. After user authentication, group authentication will take place, whereby an attempt will be made to match the group or groups (that the user belongs to) to the group filter defined here. If there is no match, the user will not pass authentication and will be blocked. If there is a match, the login permissions for the user will be retrieved from the matched group(s), unless the user already has login permissions assigned directly from the user record retrieved from the LDAP server.')
ldapBindingMethod = MibScalar((1, 3, 6, 1, 4, 1, 2, 3, 51, 2, 4, 9, 3, 6, 10), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2))).clone(namedValues=NamedValues(("clientAuthentication", 1), ("userPrincipalName", 2)))).setMaxAccess("readwrite")
