if mibBuilder.loadTexts: ldapUseDNSOrPreConfiguredServers.setStatus('mandatory')
if mibBuilder.loadTexts: ldapUseDNSOrPreConfiguredServers.setDescription("The MM contains a Version 2.0 LDAP Client that may be configured to provide user authentication through one or more LDAP servers. The LDAP server(s) to be used for authentication can be discovered dynamically or manually pre-configured. If the usePreConfiguredLDAPServers option is selected, up to 4 LDAP servers can be configured. Simply enter the server's IP address or hostname (assuming DNS is enabled). The port number for each server is optional. If left blank, the default value of 389 is used for non-secured LDAP connections. For secured connections, the default is 636. At least one server must be configured. If the useDNSToFindLDAPServers is selected, the domain name need to be provided. For LDAP Authentication Only mode, additional information such as the forest name also need to be provided.")
ldapRBSModelCfg = MibScalar((1, 3, 6, 1, 4, 1, 2, 3, 51, 2, 4, 9, 3, 6, 20), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("oldPermissionString", 0), ("newRBSModel", 1)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: ldapRBSModelCfg.setStatus('mandatory')
if mibBuilder.loadTexts: ldapRBSModelCfg.setDescription('There are two mechanisms to authenticate and authorize users on the MM when using an LDAP-enabled server. The first mechanism (oldPermissionString), also known as version 1, uses bitstrings to associate permissions to users and groups. Version1 supports Active Directory, Novell eDirectory, and OPenLDAP based servers. The second mechanism (newRBSModel), also known as version 2, uses a new Role-Based-Security (RBS) model. This mechanism is only available for Active Directory servers, and requires the use of a snap-in that runs on any windows platform. This snap-in tool allows you to configure roles on an Active Directory server of your choice, and to associate users/groups and MMs to those roles. A role identifies the permissions given to users and groups associated with that role, and also identifies the targets (e.g. MM) to which this role is attached. The use of bitstrings in version 2 disappears, making the configuration much more manageable and user-friendly. Note that if you are not using Active Directory, then you should not enable version 2. Also note that before enabling version 2, you should already have your roles configured on your Active Directory server. The old version 1 bitstring model cannot be automatically converted to the new version 2 model. This is why you must configure your users and groups before enabling version 2. Once enabled, the change takes effect immediately. The default value for this field is oldPermissionString.')
