if mibBuilder.loadTexts: cinStatusString.setDescription("Status of a Chassis Internal Network (CIN) connection. For example: Index:1 VLANID:4094 IPADDR:192.168.70.100 MAC:01:0A:0B:00:01:01 Type:Learned Status:Operational Index is the status entry number in the status table. Followed by the VLAN ID, IP address, and MAC address that the Management Module is communicating with on the CIN connection. Type is either 'Configured' or 'Learned'. Learned implies that the Management Module dynamically discovered the IP address. Configured means that the address was explicitly configured in the Management Module. Status can be 'Operational', 'Not Operational', or 'Disabled'. 'Operational' means the Management Module can ping the CIN IP address. 'Not Operational' means that the Management Module cannot ping the CIN IP address. Verify that the blade and I/O Module are configured properly and that their configurations are compatible with the Management Module. The blade OS also needs to have an IP host route defined (e.g. route add -host 192.168.70.100 eth0.4094). I/O Modules need to have a VLAN defined containing the blade's and the MM's port. Blade and I/O Modules need to be powered up and operational. 'Disabled' means that the CIN configuration has been disabled by a Management Module administrator. For consistent results, view as a table and not as individual entries.")
