if mibBuilder.loadTexts: powerManagementPolicy.setDescription('Power Module Redundancy Intended for a single power source into the chassis where each Power Module is on its own dedicated circuit. Maximum power is limited to one less than the number of Power Modules when more than one Power Module is present. One Power Module can fail without affecting compute node operation. Multiple Power Module failures can cause the chassis to power off. Note that some compute nodes may not be allowed to power on if doing so would exceed the policy power limit. Power Module Redundancy with Compute Nodes Throttling Allowed Very similar to Power Module Redundancy. This policy allows for a higher power limit; however, capable compute nodes may be allowed to throttle down if one Power Module fails. Basic Power Management Maximum power limit is higher than other policies and is limited only by the nameplate power of all the Power Modules combined. This is the least conservative approach, since it does not provide any protection for power source or Power Module failure. If any single power supply fails, compute node and/or chassis operation may be affected. Power Source Redundancy Intended for dual power sources into the chassis. Maximum power is limited to the capacity of half the number of installed power modules. This is the most conservative approach and is recommended when all power modules are installed. When the chassis is correctly wired with dual power sources, one power source can fail without affecting compute node server operation. Note that some compute nodes may not be allowed to power on if doing so would exceed the policy power limit. Power Source Redundancy with Compute Node Throttling Allowed Very similar to the Power Source Redundancy. This policy allows for a higher power limit, however capable compute nodes may be allowed to throttle down if one power source fails. Please see the powerPolicyTable for more information regarding this setting.')
