if mibBuilder.loadTexts: scalableComplexTopologyPath.setDescription("The unique identifier for a component in this table. The chassis and each installed component is represented by a hardware topology tree, where each node in the tree represents a component. The path to a particular component consists of one or more <component>,<instance> pairs, where each successive pair is a child of the previous parent pair. As an example, the root of the tree is the chassis and is represented by the pair 'CHASSIS, 1'. This pair indicates the first instance of the chassis. If a blade is inserted in slot 4 of the chassis, its topology path is 'CHASSIS, 1, BLADE, 4'. With this format, the components in the chassis can be determined along with their relative hierarchy to each other. This component table is indexed by this unique topology path and the numeric designations for the components are: CHASSIS, 0x01 Chassis MM, 0x02 Management Module BLADE, 0x03 Main system board of a blade POWER, 0x04 Power Supply, Power Module, etc COOLING, 0x05 Fan, blower, or other cooling device IO_MODULE, 0x06 Has I/O interface, i.e. - switch or bridge MEDIA, 0x07 Media device PROCESSOR, 0x08 Any processor, processor module, etc STORAGE, 0x09 Any type of storage device EXPANSION, 0x0A Expansion Card (not covered by more specific type) MEMORY, 0x0B Any memory device, module, etc MFRU, 0x0C Managed FRU Device PANEL, 0x0D Any sort of panel device, such as a front panel BLADE_EXPANSION_MODULE, 0x0E Expansion option (BEM) such as PEU, BSE, etc CARD_EXPANSION, 0x0F Expansion card, ie. daughter card CARD_HS_EXPANSION, 0x10 High Speed Expansion card, ie. daughter card INTERPOSER, 0x11 Interposer device CLOCK, 0x12 Clock card MUX, 0x13 Mulitplexer card ADDIN, 0x14 cKVM card & other addin cards STORAGE_MODULE, 0x15 Container of one or more Storage Devices SYS_EXPANSION_CARD, 0x16 Management card BATTERY, 0x17 A single battery BATTERY_MODULE, 0x18 Container of one or more batteries REAR_LED, 0x19 Rear LED card MEMORY_BANK, 0x1A Memory banks AIR_FILTER, 0x1B Filter mechanism (bezel) SERIAL_PORT_MODULE, 0x1C Container of one or more serial ports PARENT, 0x1D Reference to parent for multi-parent support PHY_PORT, 0x1E Physical port IO_EXPANDER, 0x1F RAID card CABLE, 0x20 Cable/Interconnect FAN_MUX 0x29 Fan multiplexer card PCI_EXPRESS, 0x32 PCI express card on (PEN) FLASH_DIMM, 0x33 Used for SPD devices that matches the silkscreen of the DIMM slot RACK, 0x50 Rack PLATFORM, 0x51 Generic Platform like rack mounted server/appliance DATAPLEX, 0x52 DataPlex OTHER, 0x53 Other unknown etc. PERIPHERAL_MODULE, 0x54 SYSTEM_BOARD, 0x55 System board PROCESSOR_MODULE, 0x56 BACK_PANEL, 0x57 POWER_SYSTEM_BOARD, 0x58 STORAGE_BACKPLANE, 0x59 Drive back plane PROC_BOARD, 0x5A Holds 1 or more processors POWER_DI, 0x5B Power mgt / power distribution board CHASSIS_BACK_PANEL, 0x5C SUB_CHASSIS, 0x5D OTHER_CHASSIS_BOARD, 0x5E DEVICE_MODULE, 0x5F REMOTE_DEVICE, 0x60 Remote mgt communication device EXTERNAL_ENVIRONMENT, 0x61 Such as external temp sensor for outside box temps PROC_MEMORY_MODULE, 0x62 Processors and memory on same module")
